import React, { Component, Fragment } from 'react';
import axios from 'axios';

class CardList extends Component {
    state = {
        cards: []
    }

    componentDidMount(){
        axios.get('http://localhost:5000/v1/engineer')
        .then(res => {
            console.log("res axios ",res.data.result)
            this.setState({
                cards: res.data.result 
            })
        })
    }

    render() {
        return (
            <Fragment>
               {
                   this.state.map(cards => {
                       return <Cards key={cards.id} name={cards.name_engineer}
                       desc={cards.description} />
                   })
               }
            </Fragment>
        )
    }
}

export default CardList
